const response = $input.first().json;
const text = response.content.parts[0].text;

// Extract JSON from the text response
const jsonMatch = text.match(/\[\s*\{[\s\S]*\}\s*\]/);
const verifiedData = jsonMatch ? JSON.parse(jsonMatch[0]) : [];

// Create flat mappable fields for each organization
const mappableData = verifiedData.map(org => ({
  // Organization fields
  organization_name: org.organization || null,
  organization_website: org.website || null,
  organization_linkedin: org.linkedin || null,

  // CEO fields
  ceo_name: org.ceo?.name || null,
  ceo_role: org.ceo?.role || null,
  ceo_linkedin: org.ceo?.linkedin || null,

  // Operations Lead fields
  operations_lead_name: org.operations_lead?.name || null,
  operations_lead_role: org.operations_lead?.role || null,
  operations_lead_linkedin: org.operations_lead?.linkedin || null,

  // Volunteer Lead fields
  volunteer_lead_name: org.volunteer_lead?.name || null,
  volunteer_lead_role: org.volunteer_lead?.role || null,
  volunteer_lead_linkedin: org.volunteer_lead?.linkedin || null,

  // Marketing Lead fields
  marketing_lead_name: org.marketing_lead?.name || null,
  marketing_lead_role: org.marketing_lead?.role || null,
  marketing_lead_linkedin: org.marketing_lead?.linkedin || null
}));

return mappableData;

